import { Component } from 'react';

export default class RemoveItemFromList extends Component {
  constructor() {
    super();
    this.state = {
      listaDeCompras: [
        {
          id: 0,
          item: 'Pão',
          src:'data:image/jpeg;base64,'
        },
        {
          id: 1,
          item: 'Carne',
          src:'data:image/jpeg;base64,'
        },
        {
          id:2,
          item:'Coca-Cola',
          src:'data:image/jpeg;base64,'
        },
        {
          id:3,
          item:'Nutella',
          src:'data:image/jpeg;base64,'
        }
      ],
      listaDeCompras2: [
        {
          id: 0,
          item: 'Pão',
          src:'data:image/jpeg;base64,'
        },
        {
          id: 1,
          item: 'Carne',
          src:'data:image/jpeg;base64,'
        },
        {
          id:2,
          item:'Coca-Cola',
          src:'data:image/jpeg;base64,'
        },
        {
          id:3,
          item:'Nutella',
          src:'data:image/jpeg;base64,'
        }
      ]
    };
  }
  removeItem = (idItem) => {
    const listaNova = this.state.listaDeCompras.filter(({ id }) => {
      return id !== idItem
    });
    this.setState({
      listaDeCompras: listaNova
    })
  }

  restauraLista = () => {
    
    const listaDeCompras2 = this.state.listaDeCompras2
    this.setState({
      listaDeCompras: listaDeCompras2
      
    })
    console.log('restauraLista')
  }

  render() {
    return (
      <>
        
        <div className="d-flex flex-wrap flex-column justify-content-center align-items-center py-3 my-4">

        <button className="btn btn-primary" onClick={this.restauraLista}>Restaurar 
        Lista</button>
        <br/>
        <h1>Lista de Compras</h1>
        <br/>
          {
            this.state.listaDeCompras.map(({ id, item,src }) => {
              return (
                
                
                <div key={id} onClick={() => this.removeItem(id)}>
                  <h3>{item}</h3>
                  <img src={src} alt={item}></img>
                </div>
                
              )
            })
          }
        </div>
      </>
    )
  }
}